        body: JSON.stringify({
            estatetype,
            fullname,
            phone,
            email,
            region,
            district
        })
    };
    fetch('/api/lead', requestOptions)
        .then(response => response.json())
        .then(data => nextStep()).catch(err => {this.setState({errorMessage: err})})

